#include <bits/stdc++.h>
using namespace std;
const int N = 1000000;
string a;
struct Node {
    int open;
    int closed;
};
Node t[4*N];
#define left  2 * v + 1
#define right  2 * v + 2
Node merge(Node l, Node r) {
    Node res;
    res.open = r.open;
    res.closed = l.closed;
    if (l.open >= r.closed) {
        res.open += l.open - r.closed;
    }
    else {
        res.closed += r.closed - l.open;
    }
    return res;
}
void build(int v, int l, int r) {
    if (r - l == 1) {
        if (a[l] == '(') {
            t[v] = Node { 1, 0 };
        }
        else {
            t[v] =  Node{ 0,1 };
        }
    }
    else {
        int m = (r + l) / 2;
        build(left, l, m);
        build(right, m, r);
        t[v] = merge(t[left], t[right]);
    }
}

Node result(int v, int l, int r, int ql, int qr) {
    if (l >= ql && r <= qr) {
        return t[v];
    } else if (r <= ql || l >= qr) {
        return Node{0, 0};
    } else {
        int m = (r + l) / 2;
        Node p = result(left, l, m, ql, qr);
        Node q = result(right, m, r, ql, qr);
        return merge(p, q);

    }
}
int main() {
    ios_base::sync_with_stdio(0);
    cin.tie(0);
    cin >> a;
    int k;
    cin >> k;
    int n = a.size();
    build(0, 0, n);
    for (int i = 0; i < k; ++i) {
        int l; int r;
        cin >> l >> r;
        l--;
        auto x = result(0, 0, n, l, r);
        cout << (r - l) - (x.open + x.closed) << '\n';
    }
}


